import { Col, Container, Row } from "react-bootstrap";

function Tags(){

    const ArraysOfTags = [{}];
    const ArraysOfTagsOnMap = ArraysOfTags.map((ArrayOfTags) =>
    <Col key = {ArrayOfTags.id} lg = "2" md = "4" sm = "6">
        <img src = {ArrayOfTags.image} className = "w-100"/>
    </Col>
    )

    return(
        <Container fluid>
            <Row>
                {ArraysOfTagsOnMap}
            </Row>
        </Container>
    )
}

export default Tags
